import React from 'react'
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap'


export default class Home extends React.Component {
    render () {
        return (
            <div>
                <h1>Home page</h1>

                <Form>
                    <FormGroup>
                        <Label for="username2">Enter a username to compare with</Label>
                        <Input type="textarea" name="text" id="username2" />
                    </FormGroup>
                </Form>
            </div>


        )
    }
}
